import React from "react"
import style from "./User.module.css"

const User = (props) => {
    return (
        <div className={style.user}>
            <div className={style.avatar}>
                <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcTuwuMOJFW9ykww4MywRpxONu2AflSZtm4mhY0P_i1Y_7P0J4lx"/>
            </div>
            <div className={style.name}><span>Bob</span></div>
        </div>
    )
}

export default User
